import React, { Component } from 'react';

class BoxList extends Component {
  constructor(props) {
    super(props);

    this.state = {
      str: '',
      open: false,
    }
  }

  renderList(letters) {
    return (
      letters.map(letter => <li>{letter}</li>)
    );
  }

  render() {
    const letters = ['a', 'b', 'c', 'd'];
    return (
      <div>
        <div>
          a
        </div>
        <div>
        {this.renderList(letters)}
        </div>
      </div>
    )
  }
}

export default BoxList;
